import React from 'react';
import './Button.css';
import logo from './images/logo.png';



export default class Header extends React.Component {


  render() {
    return (
    <div className="container ">
          <div className="container center">
                <img src={logo} className="img-responsive"/>
          </div>
    </div>

    );
  }

}
